import '../styles/Cart.css';
import {useState} from 'react';

function Cart() {
    const monsterPrix = 8;
    const lierrePrix = 10;
    const fleursPrix = 15;

    const [cart, updateCart] = useState(0);

    return (
        <div className='lmj-cart'>
            <h2>Panier</h2>
            <ul>
                <li>Monstera : {monsterPrix}€</li>
                <li>Lierre : {lierrePrix}€</li>
                <li>Fleurs : {fleursPrix}€</li>
            </ul>
            Total : {monsterPrix + lierrePrix + fleursPrix}€
        </div>
    );
}

export default Cart;
